long AddValue(int value)
{
    long answer = 0;
    int allNumValue = 0;
    if (allNums.TryGetValue(value, out allNumValue))
    {
        if (inBigNums.Contains(value))
        {
            (long Num, int Freq) valueToRemove = (value, allNumValue);
            bigNums.Remove(valueToRemove);
            inBigNums.Remove(value);
            allNums[value]++;
            answer -= valueToRemove.Num * valueToRemove.Freq;
            smallNums.Add((valueToRemove.Num, valueToRemove.Freq + 1));
        }
        else
        {
            (long Num, int Freq) valueToRemove = (value, allNumValue);
            smallNums.Remove(valueToRemove);
            smallNums.Add((valueToRemove.Num, valueToRemove.Freq + 1));
            allNums[value]++;
        }

    }
    else
    {
        smallNums.Add((value, 1));
        allNums[value] = 1;
    }
    answer += UpdateLists();
    return answer;
}
long RemoveValue(int value)
{
