    }


    answer += UpdateLists();

    return answer;
}
long UpdateLists()
{
    long answer = 0;
    while (bigNums.Count < x && smallNums.Count > 0)
    {
        var numToAdd = smallNums.First();
        bigNums.Add(numToAdd);
        inBigNums.Add(numToAdd.Num);
        answer += numToAdd.Num * numToAdd.Freq;
        smallNums.Remove(numToAdd);
    }
    //Console.WriteLine($"SmallNumFirst: {smallNums.First()} BigNumLast:{bigNums.Last()}");
    //Console.WriteLine(smallNums.First().CompareTo(bigNums.Last()));
    if (bigNumCount > 0 && smallNums.Count > 0)
    {
        while (CheckFirstBiggerThanSecond(smallNums.First(), bigNums.Last()))
        {
            var bigNum = bigNums.Last();
            var smallNum = smallNums.First();

            bigNums.Remove(bigNum);
            answer -= bigNum.Num * bigNum.Freq;
            smallNums.Add(bigNum);
            inBigNums.Remove(bigNum.Num);

            smallNums.Remove(smallNum);
            bigNums.Add(smallNum);
            inBigNums.Add(smallNum.Num);
            answer += smallNum.Num * smallNum.Freq;
        }
    }
    return answer;
}

bool CheckFirstBiggerThanSecond((long, int) smallNum, (long, int) bigNum)
{
    if (smallNum.Item2 > bigNum.Item2)
    {
        return true;
    }
    else if (smallNum.Item2 == bigNum.Item2)
    {
        if (smallNum.Item1 > bigNum.Item1)
        {
            return true;
        }
    }
    return false;


}

public class TupleComparer : IComparer<(long, int)>
{
    public int Compare((long, int) x, (long, int) y)
    {
        // First, compare by the first item (Item1)
        int result = y.Item2 - x.Item2;

        // If Item1 values are equal, then compare by the second item (Item2)
        if (result == 0)
        {
            result = (int)(y.Item1 - x.Item1);
        }

        return result;
    }
}
